import './App.css';
import { Routes, Route } from 'react-router-dom';
import Home from './components/home';
import Assessment from './components/assessment';
import Exercise from './components/exercise';
import Resource from './components/resource';
import PrivateRoutes from './utils/PrivateRoutes';
import PublicRoutes from './utils/PublicRoutes';
import AdminLogin from './components/admin_login';
import AdminDashboard from './components/admin_dashboard';
import AdminPrivateRoutes from './utils/AdminPrivateRoutes';
import AdminPublicRoutes from './utils/AdminPublicRoutes';
import { AuthProvider } from './context/AuthContext';
import { AdminAuthProvider } from './context/AdminAuthContext';

function App() {
  return (
    <div className='App'>
      <AuthProvider>
        <Routes>
          <Route path='/' element={<PublicRoutes />}>
            <Route path='/login' element={<Home />} />
          </Route>
          <Route path='/dashboard' element={<PrivateRoutes />}>
            <Route path='/' element={<Assessment />} />
            <Route path='/exercise' element={<Exercise />} />
            <Route path='/resource' element={<Resource />} />
          </Route>
        </Routes>
      </AuthProvider>
      <AdminAuthProvider>
        <Routes>
          <Route path='/admin' element={<AdminPublicRoutes />}>
            <Route path='/login' element={<AdminLogin />} />
          </Route>
          <Route path='/admin/dashboard' element={<AdminPrivateRoutes />}>
            <Route path='/' element={<AdminDashboard />} />
          </Route>
        </Routes>
      </AdminAuthProvider>
    </div>
  );
}

export default App;
